First let's create the type for our configuration: Add the yaml parsing crates to Cargo.toml: # [dependencies]
serde = "1.0"
serde_yaml = "0.8" Define a struct representing the config: // src/main.rs
#[derive(Serialize, Deserialize, Debug, schemars::JsonSchema)]
struct Config { greeting: String,
} Update the Greet Filter to take in greeting as a parameter: // src/main.rs
struct Greet { config: Config,
} impl Filter for Greet { fn read(&self, ctx: &mut ReadContext) -> Option<()> { ctx.contents .splice(0..0, format!("{} ", self.config.greeting).into_bytes()); Some(()) } fn write(&self, ctx: &mut WriteContext) -> Option<()> { ctx.contents .splice(0..0, format!("{} ", self.config.greeting).into_bytes()); Some(()) }
}

