Quilkin comes with out-of-the-box support for xDS management, and as such needs to communicate filter configuration over Protobuf with management servers and clients to synchronise state across the network. So let's add the binary version of our Greet configuration. Add the proto parsing crates to Cargo.toml: [dependencies]
# ...
tonic = "0.5.0"
prost = "0.7"
prost-types = "0.7" Create a Protobuf equivalent of our YAML configuration. // src/greet.proto
syntax = "proto3"; package greet; message Greet { string greeting = 1;
} Generate Rust code from the proto file: There are a few ways to generate Prost code from proto, we will use the prost_build crate in this example. Add the following required crates to Cargo.toml, and then add a build script to generate the following Rust code during compilation: # [dependencies]
bytes = "1.0" # [build-dependencies]
prost-build = "0.7" // src/build.rs
fn main() { // Remove if you already have `protoc` installed in your system. std::env::set_var("PROTOC", protobuf_src::protoc()); prost_build::compile_protos(&["src/greet.proto"], &["src/"]).unwrap();
} To include the generated code, we'll use [tonic::include_proto], then we just need to implement std::convert::TryFrom for converting the protobuf message to equivalvent configuration. // src/main.rs
mod proto { tonic::include_proto!("greet");
} impl TryFrom<proto::Greet> for Config { type Error = ConvertProtoConfigError; fn try_from(p: proto::Greet) -> Result<Self, Self::Error> { Ok(Self { greeting: p.greeting, }) }
} impl From<Config> for proto::Greet { fn from(config: Config) -> Self { Self { greeting: config.greeting, } }
} Now, let's update Greet's StaticFilter implementation to use the two configurations. // src/main.rs
use quilkin::filters::StaticFilter; impl StaticFilter for Greet { const NAME: &'static str = "greet.v1"; type Configuration = Config; type BinaryConfiguration = proto::Greet; fn try_from_config( config: Option<Self::Configuration>, ) -> Result<Self, quilkin::filters::Error> { Ok(Self { config: Self::ensure_config_exists(config)?, }) }
} That's it! With these changes we have wired up static configuration for our filter. Try it out with the following configuration: # quilkin.yaml
version: v1alpha1
port: 7001
filters:
- name: greet.v1 config: greeting: Hey
endpoints:
- address: 127.0.0.1:4321

